// [2,7,11,15] target=9

const twoSums = (arr, target) => {
  if (arr.length < 2){
    return 0;
  }
  for (let i=0; i < arr.length; i++){
    for (let j=0; j < arr.legnth; j++){
      if(arr[i] + arr[j] === target){
        return [arr[i], arr[j]]
      }
    }
  }
}

export default twoSums;
